import React from 'react'
import Button from '@material-ui/core/Button'
import Particles from 'react-particles-js'
import Grid from '@material-ui/core/Grid'
import Paper from '@material-ui/core/Paper'

const particleOpt = {
  particles: {
    number: {
      value: 200,
      density: {
        enable: true,
        value_area: 1000
      },
      move: {
        enable: true,
        speed: 1
      }
    }
  },
  interactivity: {
    events: {
        onhover: {
            enable: true,
            mode: ["push"]
        }
    }
  }
}

function Index(props) {
    return (
      <React.Fragment>
        <Particles canvasClassName="particle-canvas" params={particleOpt} />
        <Paper>
          <Grid>
            <hgroup className="introduction">
              <h1 className="display-3 text-center hello">Hello, I'm <span>Maicon Esteves</span>.</h1>
              <h2 className="display-3 text-center hello">I'm a full-stack developer.</h2>
            </hgroup>
            <Button variant="outlined" size="large" color="primary">Default</Button>
          </Grid> 
        </Paper> 
      </React.Fragment>
    );
}

export default Index
